fields.description:
Nytillverkade tankar, som ej blivit uthämtade. Isolerade med 50mm stenull och klädd med Rostfri 2333 plåt:

Surface inside/ outside 2B. Legs H=850mm.
completely insulated with Rockwool Thickness= 40mm.
No.1 Heating channel on the bottom.
DIMENSIONS: Diameter 2660mm - Total Height 7500mm
Accessories: No.1 Top Mannhole Ø 400mm;
No.1 Flange UNI 2277 PN10 DN50, on the Top;
No.1 Flange UNI 2277 PN10 DN80, on the Top;
No.2 Flange UNI 2278 PN16 DN20, on Cylinder;
No.2 Flange UNI 2278 PN16 DN25, on Cylinder;
No.1 Flange UNI 2278 PN16 DN50, for total discharge;
No.2 Flange UNI 2278 PN16 DN50, for charge connection
No.1 Flange UNI 2276 PN6 DN40, for sight gauge
No.1 Flange + blind flange Ø .450mm according to API Norm
Charge piping Ø 2”;
No.1 Sight gauge.
